  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Cold Bay Game
  Management Area and Aleutian Islands Area outlines Refuge accomplishments from September
  through December of 1949. The report begins by summarizing the weather conditions,
  water conditions, and food and cover during this period. Wildlife- including migratory
  birds, upland game birds, big game animals, furbearers, predators, rodents, mammals,
  and raptors- is also covered. Resource management is outlined; topics include fur
  harvesting. A progress report on field investigations and applied research is also
  provided. The public relations section of the report describes Refuge visitors,
  hunting, fishing, and violations. N-R forms are attached.\",\n\t\"license_title\":
